interface HelloObj {
  data: string;
  age: number;
  anotherData: string;
}

const kk : HelloObj = {data: 'Hello', age:123, anotherData: 'Another Hello'}
function HomePage() {
    return (
      <div>
        {Object.keys(kk).map(ke => 
          <p>{kk[ke]}</p>
          )}
      </div>
    )
  }

  export default HomePage
